import React from 'react';

import './homePage.css';

import SectionPreview from '../../components/sectionPreview/SectionPreview';

const HomePage = () => {
  return(
    <div className='homePage'>
      <div>#SideBar</div>
     
    <SectionPreview />  
    </div>
  )
}


export default HomePage;
